import React, { Fragment } from "react";
import Link from "next/link";
import Head from "next/head";

// styles
import "./header.module.css";

const Header = () => {
  return (
    <Fragment>
      <Head>
        <title>About Bitz</title>
      </Head>
      <ul className="navbar">
        <li className="navbar-item">
          <Link href="/">
            <a className="navbar-item__link">Home</a>
          </Link>
        </li>
        <li className="navbar-item">
          <Link href="/about">
            <a className="navbar-item__link">About</a>
          </Link>
        </li>
      </ul>
    </Fragment>
  );
};

export default Header;
